  (defun fib(x)
     (setq fcur 8)
     (setq fprev 2)
     (setq sum 10)
     (loop 
       (setq fnew (* fcur 4))
       (setq fnew (+ fnew fprev))
       (setq fprev fcur)
       (setq fcur fnew)
       (when (< x fnew) (break))
       (setq sum (+ sum fnew))
       )
      (sum))
  (printi (fib 4000000))


